pragma solidity 0.7.6;

import '@openzeppelin/contracts/token/ERC20/ERC20Capped.sol';
import '@openzeppelin/contracts/math/Math.sol';

import '../core/SafeOwnable.sol';

contract AthenaToken is ERC20Capped, SafeOwnable {
    using SafeMath for uint256;

    event MinterChanged(address indexed minter, uint maxAmount);
    event SwapPoolChanged(address indexed newSwapPool, address oldSwapPool);
    event WhitelistChanged(address indexed token, bool isWhitelist);

    uint256 public constant MAX_TOTAL_MINT = 512 * 10 ** 6 * 10 ** 18; // Total 0.512B
    uint256 public constant MAX_TOTAL_BURN = 256 * 10 ** 6 * 10 ** 18; // Total's 50%
    address public constant BURN_ADDRESS = 0x000000000000000000000000000000000000dEaD; // burnd address
    uint256 public totalBurnAmount; // Current cumulative total destroyed
    address public swapPool; // Liquidity pool address

    mapping(address => uint) public minters;
    mapping(address => bool) public whitelist;

    constructor() ERC20Capped(MAX_TOTAL_MINT) ERC20("Athena Token", "atna") SafeOwnable(msg.sender) {
        addMinter(msg.sender, uint(-1));
    }

    function setSwapPool(address _swapPool) external onlyOwner {
        require(_swapPool != address(0), "illegal pool address");
        address oldSwapPool = swapPool;
        swapPool = _swapPool;
        emit SwapPoolChanged(swapPool,oldSwapPool);
    }

    function addMinter(address _minter, uint _maxAmount) public onlyOwner {
        require(_minter != address(0), "illegal minter");
        require(minters[_minter] == 0, "already minter");
        require(_maxAmount > 0, "amount is zero");
        minters[_minter] = _maxAmount;
        emit MinterChanged(_minter, _maxAmount);
    }

    function delMinter(address _minter) external onlyOwner {
        require(_minter != address(0), "illegal minter");
        require(minters[_minter] > 0, "not minter");
        delete minters[_minter];
        emit MinterChanged(_minter, 0);
    }

    // tokens in the whitelist without fee
    function addWhitelist(address _addToken) external onlyOwner {
        require(_addToken != address(0), "token is the zero address");
        whitelist[_addToken] = true;
        emit WhitelistChanged(_addToken, true);
    }

    function delWhitelist(address _delToken) external onlyOwner {
        require(_delToken != address(0), "token is the zero address");
        delete whitelist[_delToken];
        emit WhitelistChanged(_delToken, false);
    }

    modifier onlyMinter(uint _amount) {
        require(minters[msg.sender] >= _amount, "caller is not minter or not enough");
        _;
    }

    function mint(address to, uint256 amount) external onlyMinter(amount) returns (uint) {
        minters[msg.sender] = minters[msg.sender].sub(amount);
        _mint(to, amount);
        return amount; 
    }
    function getFeeOrBurnTransferAmount(address sender,address recipient,uint256 amount) public view returns(uint256 burnAmount,uint256 feeOrBurnAmount) {

        if (whitelist[sender] || whitelist[recipient]) {
            return (0, 0);
        }
        // transfer fee
        feeOrBurnAmount = amount.div(100); // 1 %
        // check total burn
        if (MAX_TOTAL_BURN <= totalBurnAmount) {
            burnAmount = 0;
        } else if (MAX_TOTAL_BURN <= totalBurnAmount.add(feeOrBurnAmount)) {
            burnAmount = MAX_TOTAL_BURN.sub(totalBurnAmount);
        } else {
            burnAmount = feeOrBurnAmount;
        }
    }
    function transfer(address recipient, uint256 amount) public override returns (bool) {
        require(msg.sender != recipient, "recipient address is self");
        (uint256 burnAmount, uint256 feeAmount) = getFeeOrBurnTransferAmount(msg.sender,recipient,amount);
        if (burnAmount > 0) {
            totalBurnAmount = totalBurnAmount.add(burnAmount);
            amount = amount.sub(burnAmount);
            _transfer(msg.sender,BURN_ADDRESS,burnAmount);
        }
        if(swapPool != address(0) && feeAmount > 0) {
            amount = amount.sub(feeAmount);
            _transfer(msg.sender,swapPool,feeAmount);
        }
        if (amount > 0){
            _transfer(msg.sender,recipient,amount);
        }
        return true;
    }        

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        require(sender != recipient, "recipient address is sender");
        // uint256 approveAmount = amount;
        _approve(sender, msg.sender, allowance(sender,msg.sender).sub(amount, "ERC20: transfer amount exceeds allowance"));
        (uint256 burnAmount, uint256 feeAmount) = getFeeOrBurnTransferAmount(sender,recipient,amount);
        if (burnAmount > 0) {
            totalBurnAmount = totalBurnAmount.add(burnAmount);
            amount = amount.sub(burnAmount);
            _transfer(sender,BURN_ADDRESS,burnAmount);
        }
        if(swapPool != address(0) && feeAmount > 0) {
            amount = amount.sub(feeAmount);
            _transfer(sender,swapPool,feeAmount);
        }
        if (amount > 0){
            _transfer(sender, recipient, amount);
        }
        return true;
    }

}
